import {httpService} from './';
import {apiUrl} from '../config';

export const moneyWithdrawalService = {
    getAll,removeItem,getOne,EditItem,saveItem
};

const apiEndpoint = `${apiUrl}/withdrawalRequest`;


function getAll() {
    return httpService.get(apiEndpoint);
}
function removeItem(id) {
    return httpService.put(`${apiEndpoint}/cancel/${id}`);
}
function getOne(id){
    return httpService.get(`${apiEndpoint}/${id}`);

}
function EditItem(id,withdrawalObj){
    return httpService.put(`${apiEndpoint}/${id}`,withdrawalObj);

}
function saveItem(withdrawalObj){
    return httpService.post(`${apiEndpoint}`,withdrawalObj)
}
